310d41ed-9e49-46b4-8091-38f9fa7202ff	2025-03-29 16:23:18.208672	2025-03-29 16:23:13.314762	https://www.youtube.com/watch?v=ot08DY_ns88	https://i.ytimg.com/vi_webp/ot08DY_ns88/maxresdefault.webp	. 事情是这样的,. 前段时间我和一个好友聊天，. 聊到了工作。. 她说呢她最近换了份新工作，. 现在的工作让她感觉既开心又有意义，. 她觉得自己经过几年的努力，. 终于找到了适合自己的工作。. 我和这个朋友在高中时是同班同学，. 我记得那时候她特别喜欢写作，. 英语也很好。. 她说她的梦想是以后当一名记者，. 所以读大学时她选择了新闻专业。. 毕业后我们见过几次面。. 刚毕业时她在一家大公司实习，. 工资很低，公司离家也远。. 但是为了实现自己的梦想，. 她还是坚持了下来。. 实习结束后，. 她得到了去香港读研的机会。. 研究生毕业后呢，. 通过介绍她得到了现在的工作机会，. 成为了一名记者。. 看到她实现了自己的梦想，. 我真心替她感到高兴。. 因为我知道，. 找到一份自己喜欢又适合自己的工作. 真的不是一件容易的事。. 我的工作经历呢就刚好和她相反。. 我在高中时没有什么特别擅长的学科，. 但是每门学科的成绩都不差。. 在选择大学专业时我很迷茫，. 就选择了老师建议的语言专业。. 大学毕业后我面试了好几次，. 都没有找到和自己专业相关的工作。. 时间一天天过去，. 看到身边的同学几乎都找到工作了，. 我开始着急，乱投简历，. 甚至是一些和我（的）专业无关，. 完全不适合自己的工作。. 结果呢就是在毕业后的两三年里，. 我不停地辞职，换工作，. 甚至一些工作只做了一两个月。. 那时我记得我每天都很不开心，. 也很没有自信，. 觉得自己什么都做不好。. 好在虽然我走了很多弯路，. 但是这些经历也让我弄清楚了. 自己适合什么，不适合什么，. 想要什么，不想要什么，. 于是最后才找到了方向。. 我们每天都会花很多时间在工作上，. 所以工作常常对一个人的生活有很大的影响。. 每个人都希望找到一份理想的工作。. 在找工作这件事上，. 常听别人说：. “第一份工作很重要，. 它将影响你未来的职业发展。”. 因为可能有人像我的朋友一样，. 一开始就有了职业方向。. 但我想可能也有人像我一样，. 大学刚毕业没有工作经验，. 也并不知道自己想做什么，. 所以很难保证第一份工作就是适合自己的。. 那就不妨多尝试，. 试着在不同的工作中了解自己，. 提高自己的能力，. 最终你也会找到适合自己的工作。. 因为要知道人生没有无用的经历。. 那这就是今天我想和大家分享的有关找工作的话题。. 如果你有什么想说的，. 欢迎在评论区发表自己的看法。. 谢谢大家的收听，我们下次见。	Education	\N	220	0	cn	04c8b4d2-cf9d-44f5-9f63-fab7aaf17d8a	fec6fc87-cc63-4fb8-9f06-4e51a5c209b5	HSK 4/5 | 找工作 Looking for a job | Mandarin Chinese Podcast 9 | Chinese Listening Pre Intermediate	HSK5
