8f98382d-b8a7-48df-bb99-70d15955536b	2025-03-29 16:36:08.822889	2025-03-29 16:36:05.512513	https://www.youtube.com/watch?v=ri2uKTpw4lQ&list=TLGG22ei5sflST0yOTAzMjAyNQ	https://i.ytimg.com/vi_webp/ri2uKTpw4lQ/maxresdefault.webp	. ﻿Hello and welcome to another episode of Elephant \nEnglish podcasts. Today I am going to talk about  . my daily routines. I normally do the same things \nevery week but some days I do different things.  . In the United Kingdom, Sunday is normally the \nfirst day on the calendar, so I am going to  . tell you what I normally do on Sundays first.\nFor me, Sundays are for resting and relaxing. In  . the morning, I clean the living room, the kitchen \nand the bathroom. When I have finished cleaning,  . I make lunch. I normally cook a lot of food \nbecause then I can eat it on Monday or Tuesday,  . for example, and that way I don’t have to cook \nevery day. In the afternoon, I usually watch  . the Formula 1 race, but there aren’t races every \nweek. Finally, in the evening, I prepare my  . classes for the week because I am a teacher.\nMondays, Tuesdays, Wednesdays and Thursdays are  . very similar for me, but Mondays are definitely \nthe worst day of the week. I don’t like Mondays  . because I am very tired and because the days feel \nvery long. When I wake up on these days, I brush  . my teeth, I get dressed, I brush my hair, I have \nbreakfast and then I go to work at 7.30am.\n . I always have my lunch at work because \nthen I don’t have to prepare it. In the UK,  . people normally have breakfast in the morning \nafter they wake up and they normally have some  . cereals and milk and a cup of coffee or a cup \nof tea. Then, at 12 o’clock or 1 o’clock they  . have their lunch, which is normally a sandwich, a \nsalad or something else that is quite small.\n . I come home at 5pm and after that I \nsometimes have extra English classes  . in the evenings. I normally have dinner and \nbefore I go to bed I play with my cat because  . she has got a lot of energy. If I don’t play \nwith my cat, she doesn’t sleep at night, so  . this is an important thing for me to do.\nIn the UK people normally have dinner  . at 6 o’clock or a bit later, when they \ncome back from work. This is the biggest  . meal of the day and the typical British dinner \nis a roast dinner, which includes some meat,  . chicken or fish, some potatoes, some vegetables \nlike carrots, broccoli or peas. However,  . people obviously don’t eat this every day, \nand they might eat a pasta dinner, curry,  . a pie or something like that. Before going to bed, \nsome people have a snack that is called supper.  . Depending on if you are hungry or not, people \nwill have a bigger or a smaller supper.\n . On Fridays, I am normally happier because \nit is the weekend. In the evening I go for  . a walk or watch a series on Netflix. I like \nFridays but I don’t have a lot of energy  . so I normally relax and stay at home.\nFinally, I normally eat out on Saturdays.  . My favorite type of restaurants are Italian \nrestaurants because I love pasta and pizza.  . After having dinner, I go to the supermarket or to \nthe shopping center because I like to buy the food  . that I will eat during the week.\nSo, today I have talked to you about what  . I normally do every week. Sometimes I do other \ndifferent things, like going to the mountains  . or visiting a new city, but this is \njust a typical week for me. \n . What are your daily routines? What do you \nnormally do at the weekend? Tell me what you  . normally do every week in the comment section \nfor me to read. You can find the transcription  . and activities related to this topic in \nthe description box. Please like this video  . and subscribe to my channel if you liked \nthe video. Thank you and see you next time!	Education	\N	327	0	en	6bc2890e-316e-4ce0-9e57-f4b224cfdf2b	fec6fc87-cc63-4fb8-9f06-4e51a5c209b5	Beginner English listening practice/speaking practice Level 1/A1🍽🚴Talking about my daily routines	B1
