506f7dcb-7364-477b-9e71-ffc1d185c544	2025-03-29 16:13:09.010918	2025-03-29 16:13:06.110705	https://www.youtube.com/watch?v=Lv06Razi3Y4&list=TLGGwrRwf93qyosyOTAzMjAyNQ	https://i.ytimg.com/vi_webp/Lv06Razi3Y4/maxresdefault.webp	. 大家好！. 今天我想和大家聊的话题是做饭。. 你们平时是自己在家做饭吗？. 你们喜不喜欢做饭呢？. 我现在平时基本上都是在家做饭的，. 很少出去吃。. 对于做饭这件事，. 我觉得我有时候很喜欢，. 但有时候好像又不太喜欢。. 以前上学和爸妈住在一起的时候，. 在家里基本上都是我爸做饭的。. 因为他很会做饭，. 也很喜欢做饭。. 我记得以前他做饭的时候，. 如果有空的话，. 我就会在旁边帮忙。. 帮他洗洗菜、切切菜之类的，. 然后看看他是怎么做的。. 我爸爸呢就喜欢一边做菜，一边教我，. 顺便告诉我一些做菜的小妙招。. 所以我一直对做饭这件事还蛮感兴趣的。. 但是只是那时候，. 我也不知道为什么，. 从没想过要尝试自己一个人做饭。. 可能是小时候我觉得做饭是一件很危险的事情吧。. 后来工作以后，我就搬出去住了。. 我记得刚工作的那几年， 每天工作特别忙。. 大概早上七点钟出门上班，. 晚上下班回到家也要八九点钟了。. 所以平时我也懒得自己买菜做饭。. 而且我家附近有很多像早餐店啊、便利店啊、餐馆之类的，. 用手机点外卖什么的也很方便。. 所以那时候一日三餐我基本上都是在外面解决的，. 一般只有周末的时候才会在家做饭。. 一开始我也只会做一些很简单的东西，. 比如煎个鸡蛋啊，煮碗面啊，炒个饭之类的。. 后来呢我就开始慢慢尝试做一些比较复杂的菜。. 我一般都是先在网上找食谱，. 有不懂的地方再问问我爸。. 可能是因为从小就看我爸爸做菜，. 有一些经验。. 也可能是因为自己买的食材都比较新鲜，. 菜呢又都是按照我个人的喜好来做的，. 我总是觉得自己做的菜比在外面买的好吃多了。. 所以呢后来慢慢地我就基本上不怎么在外面吃了。. 自从每天在家做饭以后，. 我觉得我的饮食比以前更健康了，. 而且每月也省下了不少钱。. 至于喜不喜欢做饭，. 我觉得比起兴趣爱好，. 做饭在我看来更像是一种家务，. 甚至有时候我会觉得很麻烦。. 特别是要早起，. 或者下班以后， 我明明觉得很累，. 但还要想一想回家吃什么的时候。. 这时候呢我一般就会做一些非常简单的东西，. 或者在超市买一些相对比较健康的半成品，. 这样可以节约很多时间。. 但是如果是周末、放假. 或者我心情比较好的时候，. 做饭对我来说又会是一件比较有趣的事，. 做饭的过程呢让我觉得非常解压。. 我会尝试一些新的食谱，. 或者做一些食物和家人还有朋友分享。. 看着大家一边吃自己做的菜，. 一边夸奖自己做的东西很好吃的时候，. 我会觉得特别地开心满足。. 那这就是我今天想和大家分享的内容。. 希望对你们有一些些帮助。. 我们下次见！	Education	\N	234	0	cn	04c8b4d2-cf9d-44f5-9f63-fab7aaf17d8a	fec6fc87-cc63-4fb8-9f06-4e51a5c209b5	HSK 4/5 | 在家做饭 Cook At Home | Mandarin Chinese Podcast 3 | Chinese Listening	HSK5
