.. A microbiome is a collection. of micro-organisms that can be found\nin a particular part of the body.. it includes fungi, bacteria and\nviruses. Micro-organisms in our gut. play an important role\nin the digestive process.. They are our gut microbiome.. If we suppress something, then we stop it\nfrom happening or operating.. We heard that bitter foods\ncan suppress hunger feelings.. This means\nthat they stop people feeling hungry.. If we try to suppress a feeling,\nwe&amp;#39;re trying to stop it.. Leyla asks if bitter foods are\nthe answer at the tip of our tastebuds.. Normally, we&amp;#39;d say that something\nwe can&amp;#39;t quite remember. is on the tip of our tongue.. Here, we have tastebuds\nwhich are the receptors on our tongue. and inside our mouths that\ncan detect flavours like bitterness.. So it seems that bitter foods\ncould be very beneficial,. but they&amp;#39;re not always\nthe easiest foods to love. In BBC. Radio 4&amp;#39;s &amp;#39;The Food Programme&amp;#39;\npresenter Leyla Kazim spoke. to chef Alexina Anatole, who\npoints out that we might be consuming. more bitter food than we realise.. I think it&amp;#39;s a real perception\nissue with it.. I think people are exposed to bitterness\nway more than they think they are.. But there&amp;#39;s this perception of bitter\nand negativity, both. in terms of emotions and food, right?. Bitterness is generally\nan undesirable trait.. But there are so many\nvery very mainstream bitter things.. Such as?. Chocolate, coffee, you know, alcohol. any alcohol has a degree\nof bitterness to it.. Alexina says that many people see\nbitterness as an undesirable trait.. A trait is a characteristic. so an undesirable trait is\na characteristic that people don&amp;#39;t want.. We often see bitterness as a bad thing.\nWe also often use undesirable traits. to refer to negative aspects\nof people&amp;#39;s personalities.. Alexina points out\nthat there are a number. of mainstream\nthings that have a bitter flavour.. If 