1321842c-fa0d-4fcb-ba29-e138c262239d	2025-03-29 16:34:23.135902	2025-03-29 16:34:18.537712	https://www.youtube.com/watch?v=235MNImhIko&list=TLGGGe1ZZNs245cyOTAzMjAyNQ	https://i.ytimg.com/vi_webp/235MNImhIko/maxresdefault.webp	. Hi, I’m Mike and welcome to Oxford Online\nEnglish!. In this lesson, you can learn how to talk\nabout your job in English.. Where do you work?. What do you have to do in your job?. What kind of company do you work for?. In this class, you can learn how to answer\nquestions like this in clear, detailed English.. Ready?. Let’s start!. Part one: introducing your job.. &amp;quot;I’m a ________&amp;quot;: &amp;quot;I work in ________&amp;quot;;\n&amp;quot;I work for _________.&amp;quot;. How would you complete these sentences?. You could say something like:. &amp;quot;I’m a writer.. I work in online education.. I work for a publishing company.&amp;quot;. &amp;#39;I work in...&amp;#39; is used with a field, meaning\na type of work.. So, you can say things like:. &amp;quot;I work in finance.&amp;quot;. &amp;quot;I work in digital marketing.&amp;quot;. You can also use &amp;#39;work in&amp;#39; with a place or\na department of a company.. For example:. &amp;quot;I work in the HR department of a financial\nfirm.&amp;quot;. &amp;quot;I work in a school, teaching modern languages.&amp;quot;. Confused?. You can see that if you use &amp;#39;work in&amp;#39; to talk\nabout the type of work you do, you don’t. use an article like &amp;#39;a&amp;#39; or &amp;#39;the&amp;#39;.. If you use an article &amp;#39;a&amp;#39; or &amp;#39;the&amp;#39; after &amp;#39;work\nin&amp;#39;, it means you’re talking about the place. or department where you work.. &amp;#39;I work for…&amp;#39; is used with a company.. So, you could say:. &amp;quot;I’m a salesman.. I work for a mobile phone company.&amp;quot;. &amp;quot;I work for a law firm based in Frankfurt.&amp;quot;. Or even:\n&amp;quot;I run my own business, so I work for myself.&amp;quot;. What can you say?. Can you make sentences like this to say something\nabout your job?. Pause the video and try to make a sentence.. Say it aloud!. Next, let’s add more details to your answer.. Part two: describing your company.. &amp;quot;I work for a _________ company which __________&amp;quot;. Look at this sentence.. We need one adjective, and the end of the\nsentence after &amp;#39;which&amp;#39;.. Any ideas?. For the adjectives, think about these ideas:\nis your company big or small?. Local or multinational?. For the part after &amp;#39;which&amp;#39;, ask yourself:\nwhat does your company do?. Does it make things, sell things, organise\nthings?. Does it provide products, services, or both?. So, you could say:. &amp;quot;I work for an international electronics company\nwhich makes tablet computers.&amp;quot;. &amp;quot;I work for a German company which does market\nresearch for other companies.&amp;quot;. What if you don’t work for a company?. Here are some things you could say:. &amp;quot;I’m a freelancer.&amp;quot;. Meaning: I work independently, for different\npeople and companies.. &amp;quot;I’m self-employed.&amp;quot;. Meaning: I work for myself, either freelance\nor I have my own business.. &amp;quot;I’m a business owner.&amp;quot;. If you don’t work, and people ask you what\nyou do, what can you say?. Here are some useful phrases:. &amp;quot;I’m between jobs at the moment.&amp;quot;. Meaning: I’ve left one job, and haven’t\nfound another yet.. This sounds nicer than saying, “I’m unemployed.”. &amp;quot;I’m taking some time out to…(travel,\nspend time with my kids, write a book, recover. from an illness, etc.)&amp;quot;. Meaning: I’m not working at the moment because\nI want to focus on something else.. &amp;quot;I’m retired.&amp;quot;. What about you?. Do you work for a company?. What can you say about it?. If you don’t work for a company, how would\nyou describe your work situation?. Part three: how to describe your job in more\ndetail.. So what do you actually do all day?. Let’s see how you can describe your job\nin more detail.. Look at these sentences:. &amp;quot;I have to _________&amp;quot;; &amp;quot;I’m responsible\nfor _________&amp;quot;; &amp;quot;Most of my time is spent. _________&amp;quot;.. Let’s do some examples together.. We’ll start with a simple example.. &amp;quot;I’m a nurse.. I have to look after patients, give them medicine\nand make sure they’re comfortable.. I’m responsible for about 20-30 patients.. Most of my time is spent talking to patients\nand checking that everything is okay.&amp;quot;. Next, let’s do a more detailed example.. &amp;quot;I have to design websites to the client’s\nspecifications.. I’m responsible for the whole design process,\nso I have to take the client’s ideas and. turn them into a finished product.. Most of my time is spent experimenting with\ndifferent designs and ideas and seeing what. looks good, because attention to detail is\nimportant in this kind of work.&amp;quot;. Can you say something like this about your\njob and what you do?. Try to add details if you can.. Part four: saying how you feel about your\njob.. Now, you can hopefully say something about\nyour job and where you work.. But here’s another question: do you like\nyour job?. Why or why not?. Hopefully, you enjoy your job!. How could you describe a job which you like?. Of course, you could use general adjectives\nlike &amp;#39;good&amp;#39; or &amp;#39;interesting&amp;#39;, but here are. some specific adjectives you could use:. Stimulating :something which is stimulating\nis exciting and gives you energy.. Satisfying: means that your job gives you\na sense of achievement.. Creative: you can use your imagination when\nyou work.. Rewarding: this means your job gives you very\npositive feelings.. It’s often used to talk about jobs in which\nyou help other people.. For example, teachers or nurses might describe\ntheir jobs as rewarding.. Challenging: challenging can be positive or\nnegative, but if you use it to talk about. your job, it would have a positive meaning.. It means that your job is difficult, but in\nan interesting way which makes you think and. learn.. What if you don’t like your job?. Again, you can use general words like &amp;#39;boring&amp;#39;\nor &amp;#39;difficult&amp;#39;, which are fine but very basic.. If you want to be more creative with your\nvocabulary, here are some things you could. say:. Exhausting: describes work which makes you\nfeel very tired, either physically or mentally.. Thankless:if your work is thankless, no one\nnotices or appreciates what you do.. Mind-numbing: extremely boring.. Dead-end: describes a job which has no prospects\nfor the future.. If you have a dead-end job, you will never\nget promoted and the job will always be the. same.. Soul-destroying: describes a job which is\nextremely unpleasant and boring, and which. you really, really hate.. Part five: how to make a longer answer.. At this point, you should be able to introduce\nyour work, say where you work, give details. about what you do and say how you feel about\nyour work.. Let’s make some longer sample answers together.. First one:. &amp;quot;I’m a pharmacist.. I started my own small pharmacy, so I’m\nalso a business owner.. I have to work as a pharmacist, of course,\ngiving advice to patients and making sure. they have the right medicine.. However, I’m also responsible for the pharmacy,\nso I have to manage my staff, do the accounts,. and so on.. It’s stimulating work because I have to\ndo many different things every day, so I never. get bored.&amp;quot;. Clear?. Could you make an answer like this?. Let’s do one more:. &amp;quot;I’m a writer.. I work in online education.. I work for a big publishing company, which\nproduces different educational materials that. are used all around the world.. I have to write lesson plans and materials\nfor teachers to use in the classroom.. I spend most of my time thinking about how\nI can make different things fit together into. a lesson.. It’s very challenging work and it can be\nexhausting, but it’s also very creative. and satisfying, because I know people all\naround the world are using lessons which I. wrote.&amp;quot;. Okay, now it’s your turn!. Try to make a longer answer like this talking\nabout your job.. Use the vocabulary and structure from this\nlesson to help you.. If you want, you can post your answer in the\nvideo comments on YouTube.. We’ll give you some feedback on your answer.. That’s the end of the lesson.. I hope you learned some new ways to talk about\nyour job and what you do.. Thanks very much for watching.. See you next time!	Education	\N	630	0	en	6bc2890e-316e-4ce0-9e57-f4b224cfdf2b	fec6fc87-cc63-4fb8-9f06-4e51a5c209b5	Talking About Your Job in English - Spoken English Lesson	B2
