t curiosity didn&amp;#39;t let him leave the room.. What is this place? Very interesting. I can feel it&amp;#39;s cursed.. The curse is part of your destiny now, Ji-Woo.. The spooky ghosts in the house began to appear to Ji-Woo.. The ghosts have surrounded Ji-Woo.. The ghosts looked unhappy.. The air was cold, and Ji-Woo wanted to hide.. I can feel something. The ghosts. They&amp;#39;re calling me.. We&amp;#39;ve been waiting for you.. Welcome to this house. . What are you going to do now?. Why are you here?. Can you get me out of here?. Do you know why I&amp;#39;m here?. What can I do? Get me out of here! Stop it!. The ghosts scattered away from Ji-woo.. Some of the ghosts stayed by Ji-Woo&amp;#39;s side.. They started pushing Ji-Woo in an unknown direction.. Follow us. This way.. Ji-Woo couldn&amp;#39;t understand this situation.. Where are you taking me, where are you going?. The ghosts kept urging him forward.. A Ha-Nuel ghost appeared in front of Ji-Woo.. Ji-Woo&amp;#39;s body froze, unable to move an inch.. Ji-Woo, I can give you immortality.. Immortality? Tell me more.. Ji-Woo became curious.. He started to think like Ha-neul after reading his journal. . There&amp;#39;s going to be a huge price to pay.. Ji-Woo couldn’t think straight because of the spirits&amp;#39; scary presence.. I have to make a choice, but at what cost?. Your soul.. My soul?! Why do you want my soul?. If I have your soul, I can become immortal again.. And me? How do I become immortal?. You must read the Scroll of Immortality at the altar.. What are you going to do?. The ghosts started to surround Ji-Woo again.. The air was cold, and Ji-Woo was growing weaker.. Just say yes.. It&amp;#39;s easy. Just say yes.. Let&amp;#39;s be friends. I like you.. I said yes, it&amp;#39;s not that hard.. Ji-Woo realized something, Ji-Woo thought to himself.. Ah, I see it now, if I say yes, I&amp;#39;ll be like you!. Ji-Woo made up his mind.. He needed to get out of the situation quickly. He yelled.. Okay, I&amp;#39;ve made up my mind, now go away!. The ghosts scattered away again.. Ji-Woo got up and spoke to Ha-Nuel.. Ha-Nuel looked curious.. So, what do you want to do, are you going to say yes?. I need time to think about it.. Before we perform the ritual, I want to get your journal from the attic.. I want to learn more about immortality.. Okay, but you don&amp;#39;t have much time.. Hurry up!. Ji-Woo went back to the attic.. Ji-Woo hastily flipped through the diary.. He was flipping through the diary, looking for something.. There has to be something here that can break the curse.. There has to be something here.. He quickly flipped through the pages of the diary.. Finally, he found what he was looking for!. Voila! He really did write down how to break the curse in his diary!. The ghosts were watching him closely.. Ji-Woo pretended to be calm.. He took the book and went back to the secret room.. Ji-Woo sat down in front of the window and began the ritual to break the curse.. You have chosen immortality!. We&amp;#39;ll see about that!. Ji-Woo began to read the spell that broke the curse that haunted the place.. What are you doing?! Urgh!!. How did you know how to break the curse?!. You&amp;#39;ll never know, Ha-Nuel.. The curse was finally broken, and the ghosts were at peace.. It&amp;#39;s done. The curse has been lifted.. We will never leave you.. Ji-Woo left the house in a hurry.. He&amp;#39;ll never forget this experience.. Some secrets should stay buried.. We&amp;#39;ll always be a part of you.	Education	\N	624	0	ko	f48aecc6-514d-49d3-bdf2-6375b6f3fd2a	fec6fc87-cc63-4fb8-9f06-4e51a5c209b5	[Korean Listening] Korean Ghost Stories: The Whispering Shadows 👻	TOPIK3
