c081a84a-ca39-4bc8-98a2-236e343f2d59	2025-03-29 16:21:29.103083	2025-03-29 16:21:25.573534	https://www.youtube.com/watch?v=ot08DY_ns88	https://i.ytimg.com/vi_webp/ot08DY_ns88/maxresdefault.webp	. 事情是这样的,. 前段时间我和一个好友聊天，. 聊到了工作。. 她说呢她最近换了份新工作，. 现在的工作让她感觉既开心又有意义，. 她觉得自己经过几年的努力，. 终于找到了适合自己的工作。. 我和这个朋友在高中时是同班同学，. 我记得那时候她特别喜欢写作，. 英语也很好。. 她说她的梦想是以后当一名记者，. 所以读大学时她选择了新闻专业。. 毕业后我们见过几次面。. 刚毕业时她在一家大公司实习，. 工资很低，公司离家也远。. 但是为了实现自己的梦想，. 她还是坚持了下来。. 实习结束后，. 她得到了去香港读研的机会。. 研究生毕业后呢，. 通过介绍她得到了现在的工作机会，. 成为了一名记者。. 看到她实现了自己的梦想，. 我真心替她感到高兴。. 因为我知道，. 找到一份自己喜欢又适合自己的工作. 真的不是一件容易的事。. 我的工作经历呢就刚好和她相反。. 我在高中时没有什么特别擅长的学科，. 但是每门学科的成绩都不差。. 在选择大学专业时我很迷茫，. 就选择了老师建议的语言专业。. 大学毕业后我面试了好几次，. 都没有找到和自己专业相关的工作。. 时间一天天过去，. 看到身边的同学几乎都找到工作了，. 我开始着急，乱投简历，. 甚至是一些和我（的）专业无关，. 完全不适合自己的工作。. 结果呢就是在毕业后的两三年里，. 我不停地辞职，换工作，. 甚至一些工作只做了一两个月。. 那时我记得我每天都很不开心，. 也很没有自信，. 觉得自己什么都做不好。. 好在虽然我走了很多弯路，. 但是这些经历也让我弄清楚了. 自己适合什么，不适合什么，. 想要什么，不想要什么，. 于是最后才找到了方向。. 我们每天都会花很多时间在工作上，. 所以工作常常对一个人的生活有很大的影响。. 每个人都希望找到一份理想的工作。. 在找工作这件事上，. 常听别人说：. “第一份工作很重要，. 它将影响你未来的职业发展。”. 因为可能有人像我的朋友一样，. 一开始就有了职业方向。. 但我想可能也有人像我一样，. 大学刚毕业没有工作经验，. 也并不知道自己想做什么，. 所以很难保证第一份工作就是适合自己的。. 那就不妨多尝试，. 试着在不同的工作中了解自己，. 提高自己的能力，. 最终你也会找到适合自己的工作。. 因为要知道人生没有无用的经历。. 那这就是今天我想和大家分享的有关找工作的话题。. 如果你有什么想说的，. 欢迎在评论区发表自己的看法。. 谢谢大家的收听，我们下次见。	Education	\N	220	0	cn	04c8b4d2-cf9d-44f5-9f63-fab7aaf17d8a	fec6fc87-cc63-4fb8-9f06-4e51a5c209b5	HSK 4/5 | 找工作 Looking for a job | Mandarin Chinese Podcast 9 | Chinese Listening Pre Intermediate	HSK5
1c9de92b-abdf-4c05-aaec-4b71ebcf7449	2025-03-29 16:21:30.362167	2025-03-29 16:21:23.849702	https://www.youtube.com/watch?v=SSnDb3ffMD4	https://i.ytimg.com/vi/SSnDb3ffMD4/maxresdefault.jpg	. 今天我们要聊的话题是衣服。. 你们喜欢买衣服吗？. 我以前呢很喜欢买衣服。. 有空的时候，. 总爱跟我妈妈或者朋友去逛街买衣服。. 有时候即使什么都不买，. 只是看看漂亮的衣服，. 也会让我觉得特别开心。. 那时候我也很爱看时尚杂志和时尚节目，. 很关心现在都流行穿什么，. 然后自己也会去买一些流行的衣服穿。. 但是后来我发现很多衣服其实都不太适合我。. 别人穿得好看的衣服，. 我穿不一定好看。. 每个人呢都有自己的风格，. 找到适合自己的风格很重要。. 而且因为总爱买衣服，. 我的衣柜里总是满满的，. 总要花很多时间整理。. 一些衣服只穿了几次就不穿了，. 最后都扔掉了或者送人了，. 非常浪费钱。. 后来呢我就不太常买衣服了，. 因为我觉得衣服不需要很多，. 也不需要去买流行的款式，. 有几件适合自己的衣服就行了。. 我平时喜欢穿不同颜色的衣服，. 比如：黑色，白色，蓝色，红色等等。. 我不太喜欢穿黄色和紫色的衣服，. 因为我觉得这两种颜色我穿不太好看。. 我平常买衣服很少注意衣服的牌子，. 我不太在乎衣服是不是名牌，. 我觉得只要质量好，好看，穿着舒服就行，. 价格呢最好不要太贵。. 因为我常常是在家办公的，. 所以我喜欢穿舒服的衣服，. 我最常买的衣服是运动服和居家服。. 我的衣服都不是很贵，. 一般都是我在网上买的，. 或者打折的时候在商场买的。. 但是现在我已经很久没去商场买过衣服了，. 因为商场的东西真的是越来越贵了。. 上次我去商场看到很多衣服都要八九百，. 甚至上千块。. 现在在网上买衣服方便又便宜，. 但是缺点呢就是不能试穿，. 所以有时候难免买到一些不太合适的。. 要么尺码不对，. 太大或者太小，. 要么颜色和图片上不太一样，. 要么穿上后才发现衣服不太适合自己。. 大多数时候呢我会把衣服退掉。. 有时候觉得衣服还行，. 我也懒得找客服退，. 就留下自己穿或者送人。. 这就是关于我对买衣服这件事情的看法。. 也欢迎大家来说一说. 你们喜不喜欢买衣服？. 或者你们经常去哪儿买衣服呢？. 谢谢大家的收听，. 我们下次见。	Education	\N	222	0	cn	04c8b4d2-cf9d-44f5-9f63-fab7aaf17d8a	fec6fc87-cc63-4fb8-9f06-4e51a5c209b5	HSK 4/5 | 衣服 Clothes | Mandarin Chinese Podcast 12 | Chinese Listening Pre Intermediate	HSK5
